import React from 'react';
import Pokemon from './pokemonList';

const Home = () => {
    const [state, useState] = React.useState(false);
    return(
        <div>
            <h2>Pokedex</h2>
            <nav>
                <ul>
                    <li><button onClick={<Pokemon />}>Pokemon List</button></li>
                    <li>About</li>
                </ul>
            </nav>
        </div>
    )
}

export default Home;
